                            <div class=""car-details-info blog-content"">
                                <p>The UK formally exited the EU on 31st January 2020. The 11-month transition period meant for negotiating a new trade deal will come to an end on 31st December. But there is still no sign of a new deal. In the absence of a free trade deal, which would allow goods to be transported without any tariffs, UK will default to WTO tariffs.</p>


                                <p>
                                    Along with a good chance that taxes will be applicable to imports and exports between the UK and EU, it is also a given that customs regulations will be enacted at the border. Customs regulations will most likely result in delays at the border, causing disruption in supply chains and directly affecting fast-moving consumer goods (like vegetables, fruits, cadies, toiletries, etc.) Moreover, new IT systems need to be ins");
            WriteLiteral(@"talled and customs staff recruited to run operations at the border.
                                </p>

                                <p>
                                    More than half of the UKs import and export takes place with the EU. This means that the government and the businesses inside UK who deal with parties in the EU are presented with the great challenge of ensuring efficiency in the transport of goods between the UK and the EU. Both are largely underprepared in this regard.
                                </p>

