");
            WriteLiteral(@"                                </p>

                                <ol>
                                    <li>
                                        <h5>Avoiding Idling Waste</h5>
                                        <p>
                                            When vehicle engines are left running unnecessarily for long periods, it contributes significantly to fuel costs. If drivers make it a habit to turn off the engine when the vehicle is not running, it will save costs.
                                        </p>
                                    </li>
                                    <li>
                                        <h5>Maintaining A Stable Speed</h5>
                                        <p>
                                            Most heavy-duty vehicles consume fuel optimally when their speed is between 35 and 50 MPH. When drivers increase or decrease the speed abruptly, it causes fuel to burn up faster. Therefore, it is recommended to stay within the v");
            WriteLiteral(@"ehicles optimal fuel efficiency speed.
                                        </p>
                                    </li>
                                    <li>
                                        <h5>Using Cruise Control</h5>
                                        <p>
                                            Drivers can use the cruise control to set up a steady, consistent speed for their vehicles, which would ensure that fuel is used efficiently. However, cruise control should not be used when the traffic is heavy or when travelling uphill.
                                        </p>
                                    </li>
                                    <li>
                                        <h5>Coasting</h5>
                                        <p>
                                            Instead of using hard breaks to come to a stop at a traffic light or otherwise, drivers can learn to determine the appropriate time for stopping ahead of time and use acceler");
            WriteLiteral(@"ation minimization techniques and coasting to come to a stop. This not only helps save on fuel but also extends the vehicles lifespan.
                                        </p>
                                    </li>
                                    <li>
                                        <h5>Caring for the Vehicle</h5>
                                        <p>
